class SurveyManager {
  /**
   * Initialize the SurveyManager with empty properties
   */
  constructor() {
    this.survey = null;
    this.currentField = null;
    this.currentQuality = null;
  }
  /**
   * Clear the currentSurvey object
   */
  clearSurvey() {
    this.survey = null;
    this.currentField = null;
    this.currentQuality = null;
  }
  /**
   * Delete the current quality from the current field
   * @returns {boolean} true if success, false if fail
   */
  deleteCurrentQuality() {
    if (this.currentField && this.currentQuality && this.currentField.qualities.includes(this.currentQuality)) {
      this.currentField.deleteQuality(this.currentQuality);
      return true;
    }
    return false;
  }
  /**
   * Check the current survey for missing information 
   * @returns {string}
   */
  validateSurvey() {
    if (this.survey.projectedFields.length == 0) {
      return "Survey has no projected fields.";
    }
    for (let i2 = 0; i2 < this.survey.projectedFields.length; i2++) {
      const field = this.survey.projectedFields[i2];
      if (field.qualities.length <= 0 && field.vertices > 0) {
        return "At least one projected field needs qualities.";
      }
    }
    return "";
  }
  /**
   * Submit the currentSurvey to the server via websocket
   * @param {WebSocket} socket - the socket the survey is to be sent over
   * @param {Object} additionalData - additional data to be sent to the server
   *      along with the survey, must be JSON.stringify-able
   * @returns {boolean}
   */
  submitSurveyToServer(socket, additionalData) {
    var msg = {
      type: "submit",
      survey: this.survey.toJSON()
    };
    if (additionalData) {
      for (let prop in additionalData) {
        if (Object.prototype.hasOwnProperty.call(additionalData, prop)) {
          msg[prop] = additionalData[prop];
        }
      }
    }
    if (socket.readyState == WebSocket.OPEN) {
      socket.send(JSON.stringify(msg));
      this.currentField = null;
      this.currentQuality = null;
      return true;
    } else {
      console.error("Socket is not OPEN, cannot submit survey.");
      return false;
    }
  }
  /**
   * Pass the currentSurvey to the server via websocket
   * @param {WebSocket} socket - the socket the survey is to be sent over
   * @returns {boolean}
   */
  updateSurveyOnServer(socket) {
    if (this.survey) {
      var msg = {
        type: "update",
        survey: this.survey.toJSON()
      };
      if (socket.readyState == WebSocket.OPEN) {
        socket.send(JSON.stringify(msg));
        return true;
      } else {
        console.error("Socket is not OPEN, cannot submit survey.");
        return false;
      }
    }
  }
}
